B.NM=new A.nt("Cruel Intentions Necklaces \u2013 A Softer Aesthetic for Stronger Connections","Cruel Intentions Necklaces is a brand known for its edgy jewelry designs, but its outdated website failed to captivate users and retain their attention. The goal was to transform the website into a visually appealing, user-friendly experience that aligns with modern aesthetics and improves functionality.","-- Redesigned the website's visual identity with a softer and more inviting color palette.\n-- Optimized the user journey by rethinking navigation and reducing unnecessary steps.\n-- Enhanced accessibility to essential sections like FAQ and Contacts.","-- Balancing the brand's edgy image with a softer aesthetic to broaden its appeal.\n-- Streamlining a convoluted user journey while maintaining a logical site structure.\n-- Ensuring the redesign would directly improve user retention and engagement.\n","Visual Redesign:\n-- Replaced the dull, uninviting palette with softer, pastel-inspired tones that still complemented the brand's identity.\n-- Used clean typography and elegant design elements to create a premium feel.\n\nSimplified Navigation:\n-- Merged the two-part navigation into a single, intuitive navigation bar.\n-- Prioritized frequently accessed sections like FAQ and Contacts, moving them closer to the homepage for quicker access.\n\nStreamlined User Journey:\n-- Reduced redundancy by consolidating overlapping sections.\n-- Designed clear, action-oriented call-to-buttons to guide users effectively through the site.\n",'Current Website Analysis:\n-- 62% of users left the website within the first minute, indicating low engagement.\n-- 55% of users struggled to find essential information like FAQs and contact details.\n-- Redundant sections and two-part navigation led to a 35% higher drop-off rate on mobile devices compared to desktop.\n\nUser Feedback Highlights:\n-- 48% of surveyed users described the old design as "uninspiring" or "dull."\n-- 73% expressed a preference for simpler navigation and better access to support information.\n\nCompetitor Benchmarking:\n-- Competitor websites with cohesive aesthetics and optimized navigation saw 40\u201350% higher retention rates.',"-- User Engagement: The new aesthetic and layout led to a 25% increase in average session duration within the first month.\n-- User Retention: Streamlined navigation contributed to a 30% reduction in bounce rate, as users could find what they needed faster.\n-- Conversion Rates: FAQ and Contact sections saw a 40% increase in click-through rates, reflecting improved usability.","The redesign of Cruel Intentions Necklaces' website demonstrated how subtle but intentional design changes can significantly impact user experience and retention. By marrying aesthetics with usability, the brand is now better positioned to attract and engage its audience.","asset/images/cruel/cover.png","asset/images/cruel/cruel_1.png","asset/images/cruel/cruel_2.png",null)
B.NN=new A.nt("AdQua \u2013 Redefining Bottled Water Advertising and Distribution","AdQua isn\u2019t just a platform\u2014it\u2019s a movement. By connecting brands with water manufacturers, AdQua transforms bottled water into a mobile advertising medium while providing a seamless solution for consumers, retailers, and manufacturers to interact, purchase, and recycle.","-- Designed the mobile app for consumers.\n-- Created the website to showcase product features and attract partners.\n-- Developed a dashboard for manufacturers, brands, and retailers.\n-- Conducted extensive research on the bottled water industry in Nigeria, analyzing data such as sales volumes and pricing trends.\n      ","-- Bridging the gap between brands, manufacturers, and retailers within a single platform.\n-- Designing intuitive dashboards for three distinct user groups with unique workflows.\n-- Seamlessly integrating sustainability features like bottle recycling and rewards.","Consumer App Features:\n-- Water Ordering: Enabled consumers to buy water directly from manufacturers or retailers.\n-- Recycling Rewards: Gamified bottle recycling with a points-based system.\n-- Water Intake Tracking: Encouraged healthier habits with an integrated tracker.\n\nDashboard Features:\n-- Manufacturers: Tools to track inventory, ad campaigns, and sales trends.\n-- Brands: Campaign management tools with real-time distribution insights.\n-- Retailers: Simplified restocking at manufacturer-direct prices.\n\nUser-Centric Website:\n-- Highlighted core features with interactive demonstrations for potential partners.","-- Industry Insights: The Nigerian bottled water market generates over \u20a6800 billion annually, with manufacturers producing an average of 5 million bottles per quarter.\n-- Consumer Behavior: 63% of surveyed users preferred brands with visible sustainability initiatives, highlighting the need for the recycling rewards system.\n-- Market Potential: 72% of water manufacturers expressed interest in partnering with advertising platforms to offset production costs.","-- For Brands: Affordable advertising medium reaching diverse audiences.\n-- For Consumers: Affordable water, gamified recycling, and better hydration habits.\n-- For Retailers: Cost-effective and streamlined restocking options.\n-- For Manufacturers: Increased revenue through ad partnerships and direct sales.","Designing AdQua pushed me to consider both functional and emotional aspects of user needs. Combining sustainability with practicality, the product became more than just a service\u2014it became a tool for positive change in the industry.","asset/images/adqua/cover.png","asset/images/adqua/adqua_1.png","asset/images/adqua/adqua_2.png",null)
B.NO=new A.nt("Petrol Advisory \u2013 Fueling Convenience, Anytime, Anywhere","Petrol Advisory revolutionizes fuel accessibility by bringing it directly to users wherever they are. With features like virtual fuel storage, roadside assistance services, and a seamless delivery or pickup option, the platform addresses the challenges of traditional fueling experiences. It also empowers fuel stations with advanced dashboards to manage operations and enhance customer engagement.","-- Designed the mobile app for users.\n-- Developed the dashboard for partner fuel stations to manage deliveries, track sales, and optimize inventory.\n-- Conducted comprehensive research on fueling station operations and user needs, leveraging both online sources and in-person interviews.\n","-- Simplifying complex services such as virtual fuel storage and redemption for first-time users.\n-- Designing intuitive dashboards to help partner stations efficiently manage orders, inventory, and customer interactions.\n-- Building trust in a market where fuel delivery is a relatively new concept.\n","User-Centric Mobile App:\n-- Virtual Tank: Enabled users to purchase fuel in advance, store it securely, and redeem it whenever needed.\n-- Service Requests: Streamlined ordering for tow trucks and mechanics with real-time tracking and status updates.\n-- Delivery or Pickup Options: Offered flexibility based on user preferences, with clear pricing and time estimates.\n\nPartner Station Dashboard:\n-- Order Management: Simplified tools for tracking and fulfilling delivery or pickup requests.\n-- Inventory Insights: Real-time fuel stock monitoring to reduce shortages and overstocking.\n-- Performance Analytics: Visualized data on sales, delivery efficiency, and customer satisfaction to drive improvements.\n\nBuilding Trust with Design:\n-- Integrated live delivery tracking to provide transparency.\n-- Used a clean, professional UI with subtle visual cues to establish credibility.\n","-- Fueling Trends: 68% of users expressed interest in fuel delivery services due to long station queues and time constraints.\n-- Market Opportunity: An average urban fueling station serves over 400 vehicles daily, highlighting the need for operational efficiency and alternative delivery options.\n-- Service Demand: 73% of potential users prioritized add-on services like tow trucks and mechanics for emergencies.\n","-- Users: Achieved faster fueling with minimal effort, reliable roadside assistance, and flexible purchasing options.\n-- Partner Stations: Streamlined operations and increased sales through better order management and analytics.\n-- Sustainability: Reduced carbon emissions from idling vehicles in long station queues.\n","Petrol Advisory exemplifies how technology can modernize essential services. This project challenged me to think critically about logistics-heavy solutions and user trust. By merging research-driven design with user needs, I delivered a product that simplifies fueling while opening new revenue streams for stations..","asset/images/pa/cover.png","asset/images/pa/petrolad_1.png","asset/images/pa/petrolad_2.png",null)
B.NP=new A.nt("RateAm \u2013 Redefining ISP Transparency","RateAm empowers users with insights into Internet Service Providers (ISPs) by enabling them to rate call quality and data speeds. It also provides a network rating map to help users choose areas with reliable connectivity, making it indispensable for users in search of consistent service.","-- Designed the mobile app and website, ensuring a seamless experience across platforms.","-- Simplifying the process of rating ISPs and viewing network data.\n-- Translating technical ISP performance metrics into intuitive visuals.\n-- Establishing a cohesive design language for both the app and website.","-- Simplified User Rating System: Designed a process where users could submit ratings in under 10 seconds using a clean and intuitive interface.\n-- Interactive Network Map: Developed a color-coded map to visualize network quality in specific areas.\n-- Web-App Synergy: Created a consistent design system to unify the mobile app and website.","-- Consumer Needs: 74% of surveyed users experienced regular network issues and wanted transparency on ISP performance.\n-- Market Trends: The average Nigerian mobile user spends \u20a63,500 monthly on internet subscriptions, emphasizing the demand for better service visibility.\n-- Relocation Decisions: 68% of users indicated they would use the app to evaluate network quality before moving to a new area.","-- Users: Gained valuable insights into ISP performance, enabling informed decisions.\n-- ISPs: Benefited from data-driven feedback to improve their services.\n-- Communities: Used network quality insights to advocate for improved infrastructure.","RateAm highlighted the power of data transparency in transforming user experiences. By turning technical insights into actionable data, the platform became an essential tool for users and ISPs alike.","asset/images/rateam/cover.png","asset/images/rateam/rateam_1.png","asset/images/rateam/rateam_2.png",null)
